package pl.iroze.billingflat.model;import java.time.LocalDate;import java.time.Month;public class Example {    public static Business generate() {        Business business = new Business();        Flat flat1 = new Flat(1, "Stafa 8/22");        flat1.setRole(Role.OWNER);        business.addFlat(flat1);        Electricity electricity1 = new Electricity(1, "00000001", null);        flat1.addCounter(electricity1);        Gas gas1 = new Gas(1, "00000002", null);        flat1.addCounter(gas1);        Water water1 = new ColdWater(1, "00000003", null);        flat1.addCounter(water1);        Water water2 = new HotWater(2, "00000004", null);        flat1.addCounter(water2);        Flat flat2 = new Flat(2, "Wrzeciono 52/99");        flat2.setRole(Role.TENANT);        business.addFlat(flat2);        Electricity electricity2 = new Electricity(1, "00000011", null);        flat2.addCounter(electricity2);        Gas gas2 = new Gas(1, "00000012", null);        flat2.addCounter(gas2);        Water water3 = new ColdWater(1, "00000013", "w kuchni");        flat2.addCounter(water3);        Water water4 = new ColdWater(1, "00000014", "w lazięce");        flat2.addCounter(water4);        Water water5 = new HotWater(2, "00000015", "w kuchni");        flat2.addCounter(water5);        Water water6 = new HotWater(2, "00000016", "w lazięce");        flat2.addCounter(water6);        State state1 = new State(1, LocalDate.of(2019, Month.SEPTEMBER, 1), 211.331);        water1.addState(state1);        water1.setLastState(state1);        State state2 = new State(1, LocalDate.of(2019, Month.AUGUST, 1), 160.00);        water1.addState(state2);        water1.setSettledState(state2);        RateWater rateWater = new RateWater(1,LocalDate.of(2018,Month.AUGUST,28),9.85,14.5,54.87,6.9);        RateGas rateGas = new RateGas(2,LocalDate.of(2018,Month.AUGUST,28),1.9,8.73);        RateElectriocity rateElectriocity =                new RateElectriocity(3,LocalDate.of(2018,Month.AUGUST,28),0.2762,4.29,0.0127,0.1358,0.0037,5.38,0.45,0.52,0.23);        flat1.setRateElectriocity(rateElectriocity);        flat1.setRateWater(rateWater);        flat1.setRateGas(rateGas);        flat2.setRateElectriocity(rateElectriocity);        flat2.setRateWater(rateWater);        flat2.setRateGas(rateGas);        return business;    }}